        "description": {
          "description": "\u003cp\u003eThere are two types of declarators in C, regular declarators and abstract\n declarators. The former is for declaring variables, function parameters,\n typedefs, etc. and the latter for abstract types---\u003ccode\u003etypedef int\n ({*}foo)(void)\u003c/code\u003e vs. \u003ccode\u003ett int ({*})(void)\u003c/code\u003e. The difference between the two is\n just whether or not an identifier is attached to the declarator. We therefore\n only define one \u003ccode\u003e\u003ca\u003eDecl\u003c/a\u003e\u003c/code\u003e type and use it for both cases.\n\u003c/p\u003e",
          "module": "Language.C.Syntax",
          "name": "ArraySize",
          "package": "language-c-quote",
          "source": "src/Language-C-Syntax.html#ArraySize",
          "type": "data"
        },
